searchText:
.slide-indicator span {
    font-weight: 600;
    color: #1a1a2e;
}

/* Strategy selector */
.strategy-selector {
    position: fixed;
    top: 100px;
    left: 30px;
    background: rgba(255, 255, 255, 0.95);
    padding: 15px;
    border-radius: 15px;
    backdrop-filter: blur(10px);
    border: 1px solid rgba(255, 255, 255, 0.2);
    z-index: 1000;
    min-width: 200px;
}

.strategy-selector label {
    display: block;
    font-weight: 600;
    color: #1a1a2e;
    margin-bottom: 8px;
    font-size: 0.9rem;
}

.strategy-selector select {
    width: 100%;
    padding: 8px;
    border: 1px solid #ddd;
    border-radius: 8px;
    background: white;
    font-size: 0.9rem;
}

.strategy-info {
    margin-top: 10px;
    padding: 8px;
    background: rgba(74, 144, 226, 0.1);
    border-radius: 8px;
    font-size: 0.8rem;
    color: #333;
}

/* Animation feedback */

foundText:
.slide.red-theme h2,
.slide.red-theme h1 {
    color: white;
}

.slide.red-theme p {
    color: rgba(255, 255, 255, 0.9);
}

.slide.red-theme table {
    width: 100%;
    border-collapse: collapse;
    margin: 20px 0;
    background: rgba(255, 255, 255, 0.1);
    border-radius: 10px;
    overflow: hidden;
}

.slide.red-theme table th,
.slide.red-theme table td {
    padding: 12px;
    text-align: center;
    border-bottom: 1px solid rgba(255, 255, 255, 0.2);
    color: white;
}

.slide.red-theme table th {
    background: rgba(255, 255, 255, 0.2);
    font-weight: bold;
}

.slide.red-theme table tr:hover {
    background: rgba(255, 255, 255, 0.1);
}

/* Orbital path visualization */
.orbit-path {
    position: absolute;
    border: 2px dashed rgba(74, 144, 226, 0.3);
    border-radius: 50%;
    pointer-events: none;
    opacity: 0;
    transition: opacity 0.5s ease;
}

.showing-orbit .orbit-path {
    opacity: 1;
}

